INSERT INTO catalogue_product
VALUES ('1177', 'Crème glacée rhum-raisins', 'Crème glacée au rhum* (86 %) : eau, crème pasteurisée (23 %), sucre, préparation laitière en poudre (lactose et protéines de lait, lait écrémé, sucre), sirop de glucose de maïs, rhum* gélifié (2,2 %) (rhum* 50 % volume, gélifiant : carboxyméthylcellulose), émulsifiant : mono- et diglycérides d,acide gras d¿origine végétale, stabilisants : farine de graines de caroube - gomme guar - carraghénanes, arôme naturel, colorant : caroténoïdes. (Pourcentages exprimés sur la crème glacée au rhum*).



